INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 2, 0, "フリーマーケット会場", "青空の下で謁見", 5118061, 2834, 10118, 20063115, "ペコリーヌとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 2, 0, "フリーマーケット会場", "未来の騎空団\nマスコット？", 5118062, 2835, 10118, 20063115, "マホとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 2, 0, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 5118063, 2837, 10118, 20063115, "アキノとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 2, 0, "フリーマーケット会場", "黄金色の悩みごと", 5118064, 4108402, 10118, 20063115, "ジュンとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 2, 0, "フリーマーケット会場", "白熱！　格闘大会！", 5118065, 4107402, 10118, 20063115, "カオリとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 2, 1, "オーエド町", "祭り太鼓はオーエドの華", 5118066, 9000227, 10118, 20063115, "ニノンとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 3, 0, "フリーマーケット会場", "人気者は遅れて\nやってくる", 5118067, 2101181, 10118, 20063115, "スズナとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 3, 0, "ランドソル市街地", "巫女・ミーツ・魔法少女", 5118068, 4109402, 10118, 20063115, "ナナカとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 3, 0, "フリーマーケット会場", "ネズ耳は二度なくなる", 5118069, 4305402, 10118, 20063115, "キャル＆コッコロとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 3, 0, "ランドソル市街地", "この出会いにカンパイ！", 5118070, 4101402, 10118, 20063115, "ユカリとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 3, 0, "ランドソル市街地", "陰陽アンサンブル", 5118071, 4106402, 10118, 20063115, "アオイとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (1, 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 3, 1, "フリーマーケット会場", "運試し十番勝負！", 5118072, 2836, 10118, 20063115, "シノブとの出会い", 8, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, 0, 0, 0, 1, 0, 0, "彼女たちの新たな日常", 5118600, 0, 10118, 20063115, "オープニング", 0, 0);
